import React from "react";
import './search.css'

function Search() {




    return (
        <div className="body">
            <form action="" class="search-bar d-flex">
                <input type="search" name="search" pattern=".*\S.*" required/>
                    <button class="search-btn" type="submit">
                        <span>Search</span>
                    </button>
            </form>
        </div>
    )
}

export default Search
